import React from "react";

function App() {
  return (
    <div className="App">
      {" "}
      <div class="modal">
        <h1>Add new Task</h1>
        <form>
          <input
            type="text"
            placeholder="Please enter the project name"
            id="projectInput"
          />
          <button class="cancel" type="button">
            Cancel
          </button>
          <button class="confirm" type="button">
            Submit
          </button>
        </form>
      </div>
    </div>
  );
}

export default App;
